import React from 'react'

function Shop() {
    fetch('http://localhost:8000/api/goods/', {
        method: 'GET',
        headers: {
            'Content-Type': 'application/json',
        },
        body: JSON.stringify({
        })
    })
        .then(response => response.json())
        .then(response => {
            if (response.token) {
                localStorage.setItem('wtw-token', response.token);
            }
        })
    return (
        <div>
            <h2>Shop</h2>
        </div>
    )
}

export default Shop
